import React from "react";
import { CartItem } from "./CartItem";

const ShoppingCart = ({items, userName}) => {
  return (
    <div>
      <h1>{userName}'s Shopping Cart</h1>
      <div>
        {items.map((item) => (
            <CartItem name={item.name} img={item.img} price={item.price} />
        ))}
      </div>
    </div>
  );
};

export { ShoppingCart };
